/* Subroutine */ int dregion_(z__, it, f, vkp, f5sw, f6wa, elg)
doublereal *z__;
integer *it;
doublereal *f, *vkp, *f5sw, *f6wa, *elg;
{
    /* Initialized data */

    static doublereal a0[7] = { 1.,1.2,1.4,1.5,1.6,1.7,3. };
    static doublereal a1[7] = { .6,.8,1.1,1.2,1.3,1.4,1. };
    static doublereal a2[7] = { 0.,0.,.08,.12,.05,.2,0. };
    static doublereal a3[7] = { 0.,0.,0.,0.,0.,0.,1. };
    static doublereal a4[7] = { 0.,0.,-.3,.1,.2,.3,.15 };
    static doublereal a5[7] = { 0.,-.1,-.2,-.25,-.3,-.3,0. };
    static doublereal a6[7] = { 0.,.1,.3,.6,1.,1.,.7 };

    /* System generated locals */
    doublereal d__1;

    /* Builtin functions */
    double cos(), pow_dd();

    /* Local variables */
    static integer i__;
    static doublereal pi, f3f, f4s, f1z, f2kp;

/* ----------------------------------------------------------------------- */
/* D-region model of Danilov, Rodevich, and Smirnova, Adv. Space Res. */
/* 15, #2, 165, 1995. */

/* Input:     z    - solar zenith angle in degrees */
/*            it   - season (month) */
/*            f    - F10.7 solar radio flux (daily) */
/*            vKp  - Kp magnetic index (3-hour) */
/*            f5SW - indicator for Stratospheric Warming (SW) conditions */
/*                   =0 no SW, =0.5 minor SW, =1 major SW */
/*            f6WA - indicator for Winter Anomaly (WA) conditions */
/*                   =0 no WA, =0.5 weak WA, =1 strong WA */
/* Criteria for SW and WA indicators: */
/*      SW minor:  Temperature increase at the 30 hPa level by 10 deg. */
/*      SA major:  The same but by 20 degrees. */
/*         Temperature data for each year are published */
/*         in Beilage zur Berliner Wetterkarte (K. Labitzke et al.). */
/*      WA weak:   An increase of the absorption in the 2-2.8 MHz */
/*                 range at short A3 paths by 15 dB */
/*      WA strong: The same by 30 dB. */

/*       Only for month 12 to 2 (winter). */

/* Output:      elg(7)  alog10 of electron density [cm-3] at h=60,65, */
/*                  70,75,80,85, and 90km */
/* ----------------------------------------------------------------------- */

/* or   dimension h(7),A0(7),A1(7),A2(7),A3(7),A4(7),A5(7),A6(7),elg(7) */
    /* Parameter adjustments */
    --elg;

    /* Function Body */
    pi = 3.14159265;
    if (*z__ <= 45.) {
	f1z = 1.;
    } else {
	if (*z__ < 90.) {
	    d__1 = cos(*z__ * pi / 180);
	    f1z = pow_dd(&d__1, &c_b2) * 1.1892;
	} else {
	    f1z = 0.;
	}
    }
    f4s = 1.;
    if (*it >= 5 && *it <= 9) {
	f4s = 0.;
	*f5sw = 0.;
	*f6wa = 0.;
    }
    if (*it == 3 || *it == 4 || *it == 10 || *it == 11) {
	f4s = .5;
	*f5sw = 0.;
	*f6wa = 0.;
    }
    f2kp = *vkp;
    if (*vkp > 2.) {
	f2kp = 2.;
    }
    f3f = (*f - 60.) / 300. * f1z;
    for (i__ = 1; i__ <= 7; ++i__) {
	elg[i__] = a0[i__ - 1] + a1[i__ - 1] * f1z + a2[i__ - 1] * f2kp + a3[
		i__ - 1] * f3f + a4[i__ - 1] * f4s + a5[i__ - 1] * *f5sw + a6[
		i__ - 1] * *f6wa;
/* L1: */
    }
} /* dregion_ */



